        let xhr = new XMLHttpRequest();
        xhr.open('GET', "/api/status", true);
        xhr.responseType = 'json';
        xhr.onload = function() {
            if(xhr.status === 200) {
                update_elements(xhr.response)
            }
        }
        xhr.send();
    }
    update_data();
    setInterval(update_data, 5000);
